import React, { Component } from 'react';
import BoxUsuario from './boxes/BoxUsuario';

class App extends Component {
   render() {
      return (
         <div className="container">
            <h1>Documentação Api</h1>

            <div id="outterAccordion">

               <BoxUsuario/>

            </div>
         </div>
      );
   }
}

export default App;
